script: |
  super -f text -I q1853.spq | sort > q1853.out

inputs:
  - name: q1853.spq
    data: |
      SELECT DISTINCT + + ( - col1 ) + - + col2 + + 29 * - col2 AS col0 FROM tab1 (FORMAT parquet) AS cor0;
  - name: tab1

outputs:
  - name: q1853.out
    data: |
      -1775
      -2087
      -2894
